import React from "react";
import classNames from "classnames";

export const DelIcon = ({className}) =>{
    const classes = classNames(
        className
    )

    return(
        <svg 
        width="24" 
        height="24" 
        className = {classes}
        viewBox="0 0 24 24" 
        fill="none" 
        xmlns="http://www.w3.org/2000/svg" 
        xmlnsXlink="http://www.w3.org/1999/xlink">
            <rect x="0.153809" y="0.230774" width="23.0769" height="23.3683" fill="url(#pattern0)"/>
            <defs>
            <pattern id="pattern0" patternContentUnits="objectBoundingBox" width="1" height="1">
            <use xlinkHref="#image0_79_310" transform="scale(0.00126263 0.00124688)"/>
            </pattern>
            <image id="image0_79_310" width="792" height="802" xlinkHref="data:image/png;base64,"/>
            </defs>
        </svg>

    )
}